import Header from "./Header.jsx"
import Card from "./Card.jsx"
import contacts from "../contacts"

function App(){
  return (
    <div>
      {contacts.map(function(contact){
        return(
          <div>
            <Card id = {contact.id}
              name = {contact.name} 
              img = {contact.imgURL}
              phoneNumber = {contact.phone}
              email= {contact.email}


             />
          </div>
        )
      })}
    </div>
  )
}



